function run_optimize_weights() {
    document.getElementById("calc_results").style.display = "block";
    setTimeout(function() {
        // Call the long-running function
        optimize_weights();
      }, 10); // Short delay to allow the initial update
}

function optimize_weights() {
    var years = [2021,2022,2023,2024,2025];
    var max_val_dict = {weights:[],total_score:0};
    var slider_weights = [];
    for (var i=1; i <= 15; i++) {
        let name = "checkbox" + i;
        let slider_name = "slider" + i;
        let checkbox = document.getElementById(name);
        if (checkbox.checked) {
            weight = document.getElementById(slider_name).value;
        }
        else {
            weight = 0;
        }
        slider_weights.push(weight);
        max_val_dict.weights = JSON.parse(JSON.stringify(slider_weights));
    }
    for (var i=0; i < years.length; i++){
        max_val_dict.total_score = max_val_dict.total_score + opt_weights_find_winner(slider_weights,years[i]);
    }
    var no_changes = 1;
    while (no_changes > 0) {
        no_changes = 0;
        for (var i=1; i <= 15; i++) {
            for (var j=-100; j <= 100; j++) {
                var temp_total_score = 0;
                var temp_weights = JSON.parse(JSON.stringify(max_val_dict.weights));
                temp_weights[i-1] = j;
                for (var k=0; k < years.length; k++){
                    temp_total_score = temp_total_score + opt_weights_find_winner(temp_weights,years[k]);
                }
                if (temp_total_score > max_val_dict.total_score) {
                    no_changes = no_changes + 1;
                    max_val_dict.weights = JSON.parse(JSON.stringify(temp_weights));
                    max_val_dict.total_score = JSON.parse(JSON.stringify(temp_total_score));
                }
            }
        }
    }
    for (let j = 0, len = 15; j < len; j++) {
        let id = j+1;
        document.getElementById("checkbox"+id).checked = true;
        toggleLabel("checkbox"+id,"label"+id,"slider"+id,"slider_"+id+"_value");
        document.getElementById("slider"+id).value = max_val_dict.weights[j];
        document.getElementById("slider_" + id + "_value").value = max_val_dict.weights[j];
    }
    document.getElementById("calc_results").style.display = "none";
    find_winner();
    scroll_to_top();
}

